import React from 'react'
import './Portfolio.css'
import {Swiper,SwiperSlide} from 'swiper/react'
import 'swiper/css'

const Portfolio = () => {
  return (
    <div className="portfolio">
        {/*Heading*/}
        <span>Recent Projects</span>
        <span>Portfolio</span>

        {/*slider*/}
        <Swiper>
            <SwiperSlide>
                <img src={Sidebar} alt="" />
            </SwiperSlide>
        </Swiper>
    </div>
  )
}

export default Portfolio
